import React from 'react';

import './styles.css';

import gymImage from '../../assets/images/icons/gym.png';
import studiesImage from '../../assets/images/icons/studies.png';
import origamiImage from '../../assets/images/icons/origami.png';
import foodImage from '../../assets/images/icons/food.png';
import businessImage from '../../assets/images/icons/business.png';
import homeImage from '../../assets/images/icons/home.png';
import ideaImage from '../../assets/images/icons/idea.png';
import travelImage from '../../assets/images/icons/travel.png';

export default function Main() {

    const categories = [
        'gymImage',
        'studiesImage',
        'gymImage',
        'foodImage',
        'businessImage',
        'homeImage',
        'ideaImage',
        'travelImage',
    ]

    return (
        <div className="container">
            <form className="formAddTask">
                <select name="selectCategory" className="selectCategory">
                    <option value="0">--- Selecione uma categoria ---</option>
                    {categories.map(caregory => (
                        <option value={caregory} data-thumbnail="https://glot.io/static/img/c.svg?etag=ZaoLBh_p">{caregory}</option> 
                    ))}
                </select>
                <div className="inputAdd">
                    <input type="text" name="task" id="task" placeholder="Digite aqui a tarefa"/>
                    <button className="btn-addTask">+</button>
                </div>
            </form>
        </div>
    )
}
